import { Component, OnInit } from '@angular/core';
import { Router, RouterModule } from '@angular/router';
import { AccountService } from '../account.service';  // Import the AccountService

@Component({
  selector: 'app-account',
  templateUrl: './account.component.html',
  styleUrls: ['./account.component.css']
})
export class AccountComponent implements OnInit {
acc:any={
  accountNumber:'',
  amount:'',
  accountHolderName:''
};

  constructor(private accountService: AccountService,private router:Router) {}

  ngOnInit(): void {
    this.loadAccountDetails();
  }

  loadAccountDetails() {
    // Call a service to load the account details (you can implement this based on your backend)
    this.accountService.getAccountDetails().subscribe((data:any) => {
      this.acc = Object.values(data);

      });
  }

  deposit() {
    this.accountService.deposit(this.acc.accountNumber,this.acc.amount).subscribe(
      (data:any) => {
        this.acc = Object.values(data);  // Convert object to array
        this.loadAccountDetails();
        alert("sent Successfully")
        // this.router.navigate(['/account']);

        console.log('Deposit successful', data);
      },
      (error) => {
        console.error('Error depositing', error);
        alert("Invalid")
      }
    );
  }

  withdraw() {
    this.accountService.withdraw(this.acc.accountNumber, this.acc.amount).subscribe(
      (data) => {
        this.acc = data;  // Update account details after withdrawal
        console.log('Withdrawal successful', data);
        this.loadAccountDetails();
        alert("withdraw successfully")
      },
      (error) => {
        console.error('Error withdrawing', error);
        alert("invalid")
      }
    );
  }
}
<div class="container">
  <h1>Account Details</h1>

  <!-- Account Details Table -->
  <table class="account-table">
    <thead>
      <tr>
        <th>Account Number</th>
        <th>Account Holder Name</th>
        <th>Balance</th>
      </tr>
    </thead>
    <tbody>
      <tr *ngFor="let dat of acc">
        <td>{{ dat.accountNumber }}</td>
        <td>{{ dat.accountHolderName }}</td>
        <td>{{ dat.amount | currency }}</td>
      </tr>
    </tbody>
  </table>

  <!-- Deposit Section -->
  <div class="form-section">
    <h2>Deposit</h2>
    <mat-form-field appearance="fill" class="full-width">
      <mat-label>Account Number</mat-label>
      <input matInput [(ngModel)]="acc.accountNumber" placeholder="Enter Account Number" />
    </mat-form-field>
    <mat-form-field appearance="fill" class="full-width">
      <mat-label>Amount to Deposit</mat-label>
      <input matInput [(ngModel)]="acc.amount" placeholder="Enter Amount" />
    </mat-form-field>
    <button mat-raised-button color="primary" (click)="deposit()" class="full-width">Deposit</button>
  </div>

  <!-- Withdraw Section -->
  <div class="form-section">
    <h2>Withdraw</h2>
    <mat-form-field appearance="fill" class="full-width">
      <mat-label>Account Number</mat-label>
      <input matInput [(ngModel)]="acc.accountNumber" placeholder="Enter Account Number" />
    </mat-form-field>
    <mat-form-field appearance="fill" class="full-width">
      <mat-label>Amount to Withdraw</mat-label>
      <input matInput [(ngModel)]="acc.amount" placeholder="Enter Amount" />
    </mat-form-field>
    <button mat-raised-button color="warn" (click)="withdraw()" class="full-width">Withdraw</button>
  </div>
</div>
